import React from 'react'

export const navbar = () => {
    return (
    <nav className="navbar bg-dark">
      <h1>
        <Link to="/">
          <i className="fas fa-code" /> Analytics Dashboard
        </Link>
      </h1>
    </nav>
    )
}
